@Sagra Familja Kalkara 2018-06-13 LEJN FESTA 2018: Bhal-llum xahar.... Il-Ġimgħa 13 ta' Lulju, 2018 8:00am Ħruq ta' murtali u murtaletti. 12:00pm Ħruq ta' murtali u murtaletti. 12:30pm Ikla annwali tal-festa fis-sede tas-Soċjetà għall-partitarji kollha. Kitba mis-sede tas-Soċjetà jew mingħand il-membri tal-Kumitat Ċentrali. 8:30pm il-Banda Sagra Familja takkumpanja il-vara tas-Sagra Familja, ġawhra tal-Ġużeppini Maltin u kapolavur ta' Wistin Camilleri, permezz ta' marċ li jgħaddi minn Triq ir-Rn
..........
-istatwa tas-Sagra Familja fuq il-kolonna tagħha. 10:00 pm Jingħata bidu għall-ispettaklu pirotekniku annwali li jġib l-isem Fiamme Della Sacra Famiglia. Dan ikun jinkludi murtali tal-beraq pront, murtali bil-logħob, murtali tal-kulur, sfejjer, u blalen fost l-oħrajn. Meta l-vara tkun fi Triq ir-Rnella jinħaraq ammont ta' nar minn fuq il-bjut tal-partitarji residenti f'din it-triq. Hekk kif il-vara tas-Sagra Familja tasal viċin il-kolonna tagħha tinħaraq kaxxa nfernali sinkroniżżata mal-mużika,
